import React from 'react';
import classes from './InputTimer.module.css';

const InputTimer = ({runTimer,stopTimer,status}) => {
  return (
  <div>
  {!status.play?
  <input type="button" onClick={runTimer} className={classes.btn_play}  value='запустить таймер' />:
  <input type="button" onClick={stopTimer} className={classes.btn_stop}  value='остановить таймер'/>}
  </div>
  )};

export default InputTimer;
